myApp.controller("signinController",["$scope","$sce","$http","$routeParams","$location",function(b,a,e,c,d){$("nav.white").addClass("z-depth-0");$("div.navbar-fixed nav").show();$("div#nav").addClass("navbar-fixed");b.index.title="Sign in";b.$parent.links=[];b.$parent.btns=[];b.index.showCollapse=false;b.signin=function(){e.post("tph.php",{action:"signin",email:b.email,password:b.pwd}).then(function(f){if(f.data.message=="know"){b.index.email=f.data.email;b.index.name=f.data.name;b.index.src=f.data.picture;d.path("/")}else{Materialize.toast("User unknow!",4000)}},function(f){Materialize.toast(f,4000)})}}]);